import React from 'react';
import styled from 'styled-components';
import {DashLinkGrid, DashLink} from './dashlinkhelper';

const DashStyled = styled.div`
    border: 2px solid black;
    height: 250px;
    margin: 0px 200px 50px 500px;
`

export function DashHelper(){
    return <DashStyled>
        <DashLinkGrid>
            <DashLink>Add Category</DashLink>
            <DashLink>Add Product</DashLink>
            <DashLink>View Order</DashLink>
            <DashLink>Manage Products</DashLink>
        </DashLinkGrid>

    </DashStyled>
}
